It seriously annoys me so much... The activity table does ONE thing. Two if you have seasons. Either way it’s crafts. Jeez, GIVE US SOMETHING ELSE.

What about a sand box? A seesaw? A treehouse? A climbing-thing with a slide?

@Pixelade Boy, you’re 1/8 Italian 😭
It’s like my saying my Norwegian mom is Swedish, which sounds so ridiculous here 😳(She’s 1/8 Swedish)

No hard feelings, Pixelade. I watch every video 😗❤️ Just find it funny ~ North-North American ✨Stereotypes✨

